async () => {
  let data = await API_Get_Division.run();
  let label = data.map(item => {
    return item.Division;
  });
  for (let i = 0; i < label.length; i++) {
    JS_Filter.state.division.push({
      "label": label[i],
      "value": label[i]
    });
  }
  storeValue('authMatrixTest', JS_Filter.state.auth);
  storeValue('stateDivision', JS_Filter.state.division);
}
